import { Outlet } from 'react-router-dom';
import Navbar from './Navbar';
import Header from './Header';

const Layout = () => {
  return (
    <div>
      <Header />
      <Navbar />
      <div style={{ padding: '20px', backgroundColor: '#edf3f7', minHeight: '100vh' }}>
        <Outlet />  {/* ðŸ‘ˆ This renders nested route content like <Home /> */}
      </div>
    </div>
  );
};

export default Layout;
